&quot;Identity&quot;

When two young girls are in a tragic car 
accident, one is left in critical condition 
and the other is found dead at the scene. As 
Megan and her team investigate the case, 
however, they realize there has been an awful 
mistake. Not only was the wrong girl 
pronounced dead, but the car accident may not 
have been the actual cause of death.

